import patientProfile from "../resources/patient.profile.json";



function getArrayElementType(objArry){
  return typeof(objArry[0])
}

function createKeyValueDiv(values) {
  
  let isValuesArr = values instanceof Array;
  let subValue = null;
  let isSubValuesArr = null;
  if (isValuesArr) {
    
    return values.map(subValues => {
      return Object.keys(subValues).map(key => {
        
        if(key==='id'){
          console.log(subValues[key])
          console.log(typeof(subValues[key])  === 'string' )
          console.log(subValues[key] instanceof String)
        }
        
        subValue = subValues[key];
        let subValueType = getArrayElementType(subValue)
        isSubValuesArr = subValue instanceof Array;
        if (subValueType !== 'string') {
          return createKeyValueDiv(subValue);
        } else {
          return generateKeyValueDiv(key, subValue);
        }
      });
    });
  } else {
    return Object.keys(values).map(key => {
     
      subValue = values[key];
      isSubValuesArr = subValue instanceof Array;
      if (isSubValuesArr) {
        return createKeyValueDiv(subValue);
      } else {
        return generateKeyValueDiv(key, subValue);
      }
    });
  }
}

const DataTypes = {'Null': 'Null',
'Object': 'Object',
'Array': 'Array',
'String': 'String',
'Boolean': 'Boolean',
'Number': 'Number',
'Date': 'Date',}

function getTypeof(obj)
{
  if(obj instanceof Array) return DataTypes.Array
  else if(obj instanceof Object) return DataTypes.Object
  else if(typeof(obj)  === 'string' || obj instanceof String) return DataTypes.String
  else if(typeof(obj)  === 'number' || obj instanceof Number) return DataTypes.Number
  else if(typeof(obj)  === 'boolean' || obj instanceof Number) return DataTypes.Number
  else if(obj instanceof Boolean) return DataTypes.Boolean
  else return DataTypes.Null
  // return Object.prototype.toString.call(obj).slice(8, -1)
}


const getJsonKeyValues = jsonData => {
  return Object.keys(jsonData).map(key => {
    
    let values = jsonData[key];
    let isValueObj = values instanceof Object;
    console.log(key)

    if (key !== "text") {
      if (isValueObj) {
        let isValueArr = values instanceof Array;
        return (
          <div>
            {key} :
            {isValueArr ? createKeyValueDiv(values) : createKeyValueDiv(values)}
          </div>
        );
      } else {
        return <div>{generateKeyValueDiv(key, values)}</div>;
      }
    }
  });
};

function parseJSonToDiv(jsonData) {
  return Object.keys(jsonData).map(key => {        
    
    let values = jsonData[key];
    let valueString = null;


    switch(getTypeof(values)){
      case DataTypes.Object:
        valueString = parseJSonToDiv(values)
        break;
      case DataTypes.Array:
        if (getTypeof(values[0])=== DataTypes.Object)
        {
            valueString = values.map(subValues => { 
            return parseJSonToDiv(subValues)
          })
        }          
        else if (getTypeof(values[0]) === DataTypes.subValues)
          valueString = parseJSonToDiv(values)
        break;
      case DataTypes.String:
      case DataTypes.Boolean:
      case DataTypes.Number:
        valueString = values
        break;
      default:
        if(key === 'min'){
          console.log(values instanceof Number)
        }
        
        valueString = values.toString() + ' Error!!' 
    }

    return generateKeyValueDiv(key, valueString)
  })  
}

function generateKeyValueDiv(key, values) {
  return (
    <div>
      {key} : {values}
    </div>
  );
}

const aaaaaa = jsonData => {
  return <div>{getJsonKeyValues(jsonData)}</div>;
};

const ResourceDetails = () => {
  
  var jsonDataObj = require("../resources/patient.profile.json");
  // jsonDataObj.map(ele => console.log(ele))
  var arr = parseJSonToDiv(jsonDataObj);
  // console.log(arr)

  return <div>{arr}</div>;
  // return <div>fewfef</div>
};

export default ResourceDetails;

